import React, {forwardRef} from "react";

import '../Css/ClaseGatos.css';

function ClaseGatos(props, ref){
  return(
    <div className='gato-rpg'>
      <div className="contenedor-caracteristicas">
        <div>
          <label>Nombre: </label>
          <button></button>
        </div>
        <div>
          <label>Edad: </label>
        </div>
        <div>
          <label>Clase: </label>
        </div>
        <div>
          <label>Arma: </label>
        </div>
      </div>
      <div
      className="contenedor-gatos"
      ref={ref} >
        {props.textoG}
      </div>
  </div>
  );
};

export default forwardRef(ClaseGatos);
